          <a href="#director">Від Директора</a>
          <a href="#more-serv">Більше Послуг</a>
          <a href="#clients">Відгуки</a>
          <a href="#contacts">Контакти</a>
          <a href="/bonus">Програми</a>
          {/* Додайте інші посилання за потребою */}
        </ul>
      </nav>
    </header>
  );
};

